class SchemaValidationError(ValueError):
    """Raised when payloads fail schema validation."""

def _load_jsonschema() -> Any:
    try:
        import jsonschema  # type: ignore
    except ImportError as exc:
        raise RuntimeError(
            "jsonschema is required for runtime validation. "
            "Install with: pip install decision-gate[validation]"
        ) from exc
    return jsonschema

def validate_schema(instance: JsonValue, schema: Mapping[str, JsonValue]) -> None:
    """Validate a payload against a JSON schema."""
    jsonschema = _load_jsonschema()
    try:
        jsonschema.validate(instance=instance, schema=schema)
    except jsonschema.ValidationError as exc:
        raise SchemaValidationError(str(exc)) from exc

